import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { getAuth, signInWithEmailAndPassword } from 'firebase/auth';
import { handleError, handleSuccess, Icon } from '../utils'; // Path adjusted

// The firebase app should be globally accessible after initialization via useFirebase
// If not, we will initialize getAuth here.
const auth = getAuth(); // Assumes Firebase is already initialized by the time this runs

function Login() {
    const [loginInfo, setLoginInfo] = useState({
        email: '',
        password: ''
    });
    const [isSubmitting, setIsSubmitting] = useState(false);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setLoginInfo(prevLoginInfo => ({
            ...prevLoginInfo,
            [name]: value
        }));
    };

    const handleLogin = async (e) => {
        e.preventDefault();
        const { email, password } = loginInfo;
        
        if (!email || !password) {
            return handleError('Email and password are required.');
        }

        setIsSubmitting(true);
        try {
            // Firebase Authentication: Sign in user
            await signInWithEmailAndPassword(auth, email, password);
            
            // Success is handled by Firebase's onAuthStateChanged listener, 
            // which will trigger the parent component (App.js) to navigate.
            handleSuccess('Login successful. Redirecting...');
            
            // No need for explicit navigation or localStorage.
            
        } catch (error) {
            let errorMessage = 'Login failed. Please check your credentials.';

            // Firebase error code handling
            if (error.code === 'auth/invalid-email') {
                errorMessage = 'Invalid email address format.';
            } else if (error.code === 'auth/user-not-found' || error.code === 'auth/wrong-password') {
                errorMessage = 'Invalid email or password.';
            } else if (error.code === 'auth/too-many-requests') {
                 errorMessage = 'Access temporarily blocked due to too many failed login attempts. Try again later.';
            }
            
            handleError(errorMessage);
            console.error("Login Error:", error.message);

        } finally {
            setIsSubmitting(false);
        }
    };

    return (
        <div className='min-h-screen flex items-center justify-center bg-gray-50 p-4'>
            <div className="w-full max-w-md bg-white p-8 md:p-10 rounded-2xl shadow-2xl border border-gray-100">
                <div className="flex justify-center mb-6">
                    <Icon name="logo" className="w-12 h-12 text-indigo-600" />
                </div>
                <h1 className='text-3xl font-extrabold text-gray-900 text-center'>Welcome Back!</h1>
                <p className='text-md text-gray-500 text-center mt-2 mb-8'>
                    Log in to access your BudgetFlow dashboard.
                </p>
                <form onSubmit={handleLogin} className='space-y-6'>
                    
                    {/* Email Input */}
                    <div className='space-y-1'>
                        <label htmlFor='email-login' className='block text-sm font-medium text-gray-700'>
                            Email Address
                        </label>
                        <div className="relative">
                            <input
                                onChange={handleChange}
                                type='email'
                                name='email'
                                id='email-login'
                                placeholder='you@example.com'
                                value={loginInfo.email}
                                className='w-full p-3 pl-10 border border-gray-300 rounded-xl focus:ring-indigo-500 focus:border-indigo-500 transition shadow-sm'
                                required
                            />
                            <Icon name="email" className="w-5 h-5 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
                        </div>
                    </div>

                    {/* Password Input */}
                    <div className='space-y-1'>
                        <label htmlFor='password-login' className='block text-sm font-medium text-gray-700'>
                            Password
                        </label>
                        <div className="relative">
                            <input
                                onChange={handleChange}
                                type='password'
                                name='password'
                                id='password-login'
                                placeholder='Enter your password'
                                value={loginInfo.password}
                                className='w-full p-3 pl-10 border border-gray-300 rounded-xl focus:ring-indigo-500 focus:border-indigo-500 transition shadow-sm'
                                required
                            />
                            <Icon name="lock" className="w-5 h-5 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
                        </div>
                    </div>

                    {/* Submit Button */}
                    <button 
                        type='submit' 
                        disabled={isSubmitting}
                        className={`w-full flex justify-center py-3 px-4 border border-transparent rounded-xl shadow-lg text-lg font-bold text-white transition duration-200 
                            ${isSubmitting ? 'bg-indigo-400 cursor-not-allowed' : 'bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500'}`}
                    >
                        {isSubmitting ? (
                            <div className="flex items-center">
                                <Icon name="loading" className="animate-spin w-5 h-5 mr-3" /> Logging In...
                            </div>
                        ) : (
                            'Login'
                        )}
                    </button>
                    
                    {/* Switch Link */}
                    <div className='text-center text-sm mt-4'>
                        <span className='text-gray-600'>Don't have an account? </span>
                        <Link to="/signup" className='font-medium text-indigo-600 hover:text-indigo-500 transition'>
                            Sign up here
                        </Link>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Login;
